import axios from "axios";

export async function fetchData() {
    try { 
      const response = await axios.get(`http://127.0.0.1:8000/mcq/${endp}`);
      console.log(response.data);
      return response.data;
      
    } catch (error) {
        console.log(error);
    }
  }
